por unanimidade dos votos dos presentes, acompanhando o voto do Relator, decidiram 
conhecer e NEGAR PROVIMENTO aos recursos de ofício interposto pelo Diretor 
do DRI e voluntário impetrado pelo sujeito passivo, para manter na integralidade a decisão recorrida, proferida em 11/06/2005, em que foi deferido parcialmente o pedido 
de revisão do lançamento do IPTU correspondente aos exercícios de 2001, retroativo a 
1999, 2002, 2003, 2004 e 2005, em relação ao imóvel codificado sob o nº055.056.947-03, alterando a partir de 2001 a área construída para 604,25 m2, o tipo/padrão/subpadrão para A-2.5 e o ano base de depreciação 1983, conforme vistoria realizada no 
local em 03/09/2002, mantendo-se os demais dados de áreas e fatores inalterados, nos 
termos da lei nº9.927/98 e alterações posteriores.

